import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { HomePage, ContactPage, VehiclePage } from './pages';

function App() {
  return (
    <div>
      <BrowserRouter>

        <nav></nav>

        <Routes>
          <Route path="/" element={<HomePage />}></Route>
          <Route path="/" element={<ContactPage />}></Route>
          <Route path="/" element={<VehiclePage />}></Route>
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
